import base64
import positions_pb2
encoded_data = ""

decoded_data = base64.b64decode(encoded_data)

print(decoded_data)

print(decoded_data[:20])
# Create an empty PositionList message
position_list = positions_pb2.PositionList()

# Parse the binary data into the PositionList object
position_list.ParseFromString(decoded_data)

# Now, you can access the positions in the list
for position in position_list.positions:
    print(f"Position ID: {position.position_id}")
    print(f"Symbol: {position.symbol}")
    print(f"Status: {position.status}")
    print(f"Volume: {position.volume}")
    print(f"Open Price: {position.open_price}")
    print(f"Closed Price: {position.closed_price}")
    print(f"Duration: {position.duration}")
    print(f"Commission: {position.commission}")
    print(f"Swap: {position.swap}")
    print(f"Profit: {position.profit}")
    print("----------")